const initialState = {
  users_mobile: [],
  msg: null,
  loading: true,
  error: {},
};

// eslint-disable-next-line
export default function (state = initialState, action) {
  const { type, payload } = action;
  switch (type) {
    case USER_LOADED:
      return {
        ...state,
      };

    default:
      return state;
  }
}
